  return (
    <BaseHeader>
      <Button
        variant="contained"
        className="header-button"
        onClick={handleLoginClick}
      >
        Login
      </Button>
      <Button
        variant="contained"
        className="header-button"
        onClick={handleSignupClick}
      >
        Sign Up
      </Button>
    </BaseHeader>
  );
};

export default HeaderTwo;
